import React, {Component} from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {

  constructor() {
    super();

    this.state = {
      monsters: [
        {
          name: "Frankenstein",
          surname: "Ololo",
          id: "1"
        },
        {
          name: "Dracula",
          surname: "Ololo",
          id: "2"
        },        
        {
          name: "Zombie",
          surname: "Ololo",
          id: "3"
        },
        {
          name: "Your mom",
          surname: "Ololo",
          id: "4"
        },
      ]
    }
  }
  componentDidMount(){
    fetch('http://jsonplaceholder.typicode.com/users')
    .then(response => console.log(response))
  }
  render(){
    return (
      <div className="App">
        {this.state.monsters.map( monster => 
        (
          <h1 key={monster.id}>  {monster.name} </h1>
        ))
        }
      </div>
    );
  }
}

export default App;
